import logo from './logo.svg';
import './App.css';
import Homepage from "./Components/Homepage";
import LoanApplication from "./Components/LoanApplication"; 
import ProductExploration from "./Components/ProductExploration";
import AccountTransactionManagement from "./Components/AccountTransactionManagement";
import CreditCardApplication from "./Components/CreditCardApplication";




function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>

      <main className="Homepage">
        <Homepage />
      </main>

      <div className="LoanApplication">
        <LoanApplication />
      </div>
      <div className='ProductExploration'>
        <ProductExploration />
      </div>
      <div className='AccountTransactionManagement'>
      <AccountTransactionManagement />
      </div>
      <div className='CreditCardApplication'>
        <CreditCardApplication />
      </div>
    </div>
  );
}

export default App;
